    color VARCHAR(16) ,
    director_name VARCHAR(32) ,
    num_critic_for_reviews NUMERIC(4, 1),
    duration NUMERIC(4, 1),
    director_facebook_likes NUMERIC(6, 1),
    actor_3_facebook_likes NUMERIC(6, 1),
    actor_2_name VARCHAR(28) ,
    actor_1_facebook_likes NUMERIC(7, 1),
    gross NUMERIC(10, 1),
    genres VARCHAR(64) ,
    actor_1_name VARCHAR(27) ,
    movie_title VARCHAR(88) ,
    num_voted_users NUMERIC(8, 1),
    cast_total_facebook_likes NUMERIC(7, 1),
    actor_3_name VARCHAR(30) ,
    facenumber_in_poster NUMERIC(3, 1),
    plot_keywords VARCHAR(149) ,
    movie_imdb_link VARCHAR(52) ,
    num_user_for_reviews NUMERIC(5, 1),
    language VARCHAR(10) ,
    country VARCHAR(20) ,
    content_rating VARCHAR(9) ,
    budget NUMERIC(12, 1),
    title_year NUMERIC(5, 1),
    actor_2_facebook_likes NUMERIC(7, 1),
    imdb_score NUMERIC(2, 1),
    aspect_ratio NUMERIC(4, 2),
    movie_facebook_likes NUMERIC(7, 1)
